import React from 'react';
import { Container } from 'reactstrap';
import { Flex } from 'antd';
import Button from '../../Button/index.tsx';
import Back from '../../../public/Back.svg'

function Consultations() {
    const history = history();

  const goBack = () => {
    history.goBack(); // Переход на предыдущую страницу
  };

  return (
    <div>
      <Container className='d-flex flex-column align-items-center justify-content-center'>
        <h1>Консультации</h1>
        <Flex justify="space-between" align='center'>
          <Flex>
            <img src={Back} width={100} alt='back' onClick={window.history.back()}></img>
          </Flex>
          <Flex justify="space-between" align="center" vertical>
            <Button queue>Консультация по выбору специальностей</Button>
            <Button queue>Изменение приоритетов</Button>
          </Flex>
        </Flex>

      </Container>
    </div>
  )
}

export default Consultations
